  KEY `of_agente` (`agenteId`),
  KEY `of_formaPago` (`formaPagoId`),
  KEY `of_tipoProyecto` (`tipoProyectoId`),
  KEY `of_contrato` (`contratoId`),
  CONSTRAINT `of_agente` FOREIGN KEY (`agenteId`) REFERENCES `comerciales` (`comercialId`),
